import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import AdminPrivateRoute from './AdminPrivateRoute';
import PublicRoute from './PublicRoute';
import MainLayout from './layouts/MainLayout'; // Import the new layout
import ProductDetail from './ProductDetail'; // Import your ProductDetail component

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <AdminPrivateRoute path="/admin" name="Admin" />
          <PublicRoute path="/" exact name="Home" />

          {/* Use MainLayout for product detail routes */}
          <Route path="/product/:category/:product" render={(props) => (
            <MainLayout>
              <ProductDetail {...props} />
            </MainLayout>
          )} />

        </Switch>
      </Router>
    </div>
  );
}

export default App;
